'use strict';
({params, imports}) => {
  const encounter = params.entity;
  const formElement = params.formElement;

   const calculateSumOfObservationValues = function(encounterTypeName, observationName) {          
          return encounter.individual.getEncounters()
            .filter((enc) => enc.encounterType.name === encounterTypeName )
            .filter((enc) => enc.latestEntityApprovalStatus &&  enc.latestEntityApprovalStatus.approvalStatus.status === 'Approved' )
            .map((enc) => enc.getObservationReadableValue(observationName))
            .reduce((total, val) => total + parseFloat(val), 0);;
    }

  const value = calculateSumOfObservationValues('Work order daily Recording - Farmer','Total Silt carted').toFixed(2);
  return new imports.rulesConfig.FormElementStatus(formElement.uuid, true, value);
};

