({params, imports}) => {
  const encounter = params.entity;
  const moment = imports.moment;
  const formElement = params.formElement;
  const _ = imports.lodash;
  let visibility = false;
  let value = null;
  let answersToSkip = [];
  let validationErrors = [];

  let totalSiltExcavated = encounter.getObservationReadableValue('b0317c53-e6ec-4c05-bd1a-87dcab4c1570');
  let siltAsPerMbRecording = encounter.getObservationReadableValue('e0019970-a7c0-423c-876c-d607c9acd36b');
  console.log('totalSiltExcavated----->',totalSiltExcavated);
  if (totalSiltExcavated && siltAsPerMbRecording) {

  let absoluteValue = Math.abs( totalSiltExcavated - siltAsPerMbRecording ) ;
  let averageValue = (totalSiltExcavated + siltAsPerMbRecording) / 2 ;

  visibility = true;
  value = ((absoluteValue/averageValue) * 100).toFixed(2);

  }

  return new imports.rulesConfig.FormElementStatus(formElement.uuid, visibility, value, answersToSkip, validationErrors);
};

